 , data_purchase AS
 (
    SELECT
     member_id
     , basket_service_type
     , device
     , CASE WHEN attribute IS NULL OR attribute IN ('', 'NULL') THEN 'unknown' ELSE attribute END AS attribute
    FROM
     common_purchase.v_view_purchase_detail
    WHERE
     dt BETWEEN CAST(CAST(CONCAT('{{集計月：yyyy-mm}}', '-01') AS DATE) - INTERVAL '2' MONTH AS VARCHAR) AND CONCAT('{{集計月：yyyy-mm}}', '-31')
     AND member_id IN (SELECT member_id FROM data_open_id)
 )
 , data_point AS
 (
    SELECT
     account_id AS member_id
     , client_type AS basket_service_type
     , CASE WHEN floor_id LIKE '%r18%' THEN 'adult' WHEN floor_id LIKE '%com%' THEN 'general' ELSE 'unknown' END AS attribute
     , user_device AS device
    FROM
     common_emoney.v_history_view
    WHERE
     dt BETWEEN CAST(CAST(CONCAT('{{集計月：yyyy-mm}}', '-01') AS DATE) - INTERVAL '2' MONTH AS VARCHAR) AND CONCAT('{{集計月：yyyy-mm}}', '-31')
     AND account_id IN (SELECT member_id FROM data_open_id)
     AND transaction_type = 'use'
 )
 , union_purchase_point AS
 (
    SELECT
     member_id
     , basket_service_type
     , attribute
     , device
    FROM
     data_purchase
    
    UNION ALL

    SELECT
     member_id
     , basket_service_type
     , attribute
     , device
    FROM
     data_point
 )

SELECT
 basket_service_type
 , attribute
 , COUNT(DISTINCT member_id) AS uu
FROM
 union_purchase_point
GROUP BY
 basket_service_type
 , attribute
ORDER BY
 COUNT(DISTINCT member_id) DESC


LIMIT 1000
